		top: 0;
		width: 100%;
	}
	.profile {
		display: flex;
		gap: 5px;
	}
	header {
		width: 100%;
		height: 70px;
		display: flex;
		justify-content: center;
		background-color: #ffffff;
		color: #000000;
		position: fixed;
