		opacity: 1;
	}
	.transparent .usercontrols .block svg {
		stroke: #ffffff;
	}
	.image {
		width: 30px;
		height: 30px;
		object-fit: cover;
		border-radius: 50%;
		overflow: hidden;
	}
	.image img {
		width: 100%;
		height: 100%;
		object-fit: cover;
	}
	ul {
		list-style: none;
		padding: 0;
		margin: 0;
		display: flex;
		align-items: center;
	}
	a {
		text-decoration: none;
	}
	.logo {
		display: flex;
	}
	nav {
		width: 100%;
		max-width: 1670px;
		padding: 0 30px;
		height: 100%;
		display: flex;
		flex: 1;
		align-items: center;
	}
	ul {
		width: 100%;
	}
	.mobilemenu {
		display: none;
	}
	.block {
		display: flex;
		align-items: center;
		justify-content: center;
		gap: 10px;
		position: relative;
		cursor: pointer;
	}

	.usercontrols {
		display: flex;
		gap: 20px;
		align-items: center;
		margin-right: 10px;
	}
	.links {
		display: flex;
	}
	.links ul li:nth-child(1) {
		margin-left: 20px;
	}
	.mobileMenuButtons {
		display: flex;
		flex-direction: column;
		width: 100%;
		gap: 1rem;
		margin-bottom: 1rem;
	}
	.links ul li a {
		color: #000000;
		text-decoration: none;
		font-weight: 600;
		margin-left: 30px;
		opacity: 0.8;
		transition: all 0.3s ease-in-out;
	}
	.links ul li a:hover {
		opacity: 1;
		transition: all 0.3s ease-in-out;
	}
	.block3 {
		margin-left: auto;
		display: flex;
		align-items: center;
	}
	.block3 ul {
		display: flex;
		align-items: center;
	}
	.block3 ul li {
		display: flex;
		align-items: center;
		gap: 0.5rem;
	}
	button {
		background: var(--red2);
		border: none;
		border-radius: 4px;
		padding: 8px 16px;
		display: flex;
		align-items: center;
		justify-content: center;
		font-size: 14px;
		gap: 0.5rem;
		color: #ffffff;
		font-weight: 600;
		cursor: pointer;
	}
