		font-weight: 600;
		opacity: 0.8;
		transition: all 0.3s ease-in-out;
		cursor: pointer;
	}
	.signin:hover {
		opacity: 1;
		transition: all 0.3s ease-in-out;
	}
	.mobileSignUp {
		display: none;
		gap: 20px;
	}
	.mobileMenu {
		display: none;
	}
