			display: flex;
			flex-direction: column;
			align-items: center;
		}
		.mobileMenuLinks ul li {
			width: 100%;
			display: flex;
			justify-content: center;
		}
		.mobileMenuLinks ul li a {
			padding: 10px 0;
			display: flex;
			justify-content: center;
			width: 100%;
			font-size: 20px;
			font-weight: 600;
			font-size: 1.2rem;
			opacity: 0.8;
			transition: all 0.3s ease-in-out;
			color: #000;
			text-decoration: none;
		}
		.mobileMenuLinks ul li a:hover {
			background-color: var(--gray4);
			transition: all 0.3s ease-in-out;
		}
